        public static string firstText = "4neso Rotator";
        private int  SaveThis( PictureBox po,string p,int count=0)
        {
            try
            {
                Image bitmap = po.Image;

                PointF firstLocation = new PointF(0f, 0f);
                string imageFilePath = p + ( "_" );
                using (Graphics graphics = Graphics.FromImage(bitmap))
                {
                    using (Font arialFont = new Font("Arial Black", Bestfont(bitmap)))
                    {
                        graphics.DrawString(firstText, arialFont, Brushes.Orange, firstLocation);

                    }
                }

                imageFilePath += count+"." + comboBox1.SelectedItem.ToString();
                bitmap.Save(imageFilePath, this.format);
                return 1;
            }
            catch { }
            return 0;

        }

        public static  float Bestfont(Image pv)
        {
            try
            {
                float f = pv.Height / 20;
                f = f / 3 * 2;
                if (f < 5)
                    return  5;

                return f;
            }
            catch { }
            return 10;
        }


